package forloop;

public class forloop {
              
	
	 public void m1() {
	
	for(int i=1; i<=10; i++) {
		
		System.out.print(i+" ");
     	}
	
	 }
	
	public static void main(String[] args) {
		// TODO Auto-generated method stub
     
	    forloop fo = new forloop();	
		fo.m1();
		
	}

}
